import { ajax } from 'rxjs/ajax';
import { of, map, switchMap } from 'rxjs';

const sendAjax = (url, body) => of(body).pipe(map(objJSON => JSON.stringify(objJSON)), switchMap(query => ajax({
  url,
  method: 'POST',
  headers: {
    'Content-Type': 'application/json; charset=utf-8'
  },
  body: query
})));

export default sendAjax;
